import React from 'react'



export function NavLink(props) {
    return (
    <div className="Navbar center">
    <a href={`${props.id}`} title={props.title}>
        {props.title}
    </a>
    </div>
    );
}

export function FooterLink(props) {
    return (
        <div className="Footer-nav center">
            <a href={`${props.id}`} 
                target="_blank" 
                rel="noopener noreferrer"
                title={props.title}>
                    {props.title}
            </a>
        </div>
    );
}
